function About() {
  return (
    <div>
      <Nav />
      <Grid container spacing={3}>
        <Grid item xs={6}>
          <img src={photo} id="photo"></img>
        </Grid>
        <Grid item xs={6} id="textbox" align="center">
          <h1>JOIN THE REVOLUTION</h1>
          <p>
